import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    <ul>
        <li>Learn React</li>
        <li>Build Awesome App</li>
    </ul>
};

const el = (
    <div>
        <h1>My Todo List</h1>
        <input placeholder="search"/>
    </div>
);

ReactDOM.render(
    el,
    document.getElementById('root')
);
